-verbose
-target 11
-dontshrink
-dontoptimize
-dontskipnonpubliclibraryclasses
-dontskipnonpubliclibraryclassmembers
-dontusemixedcaseclassnames
-keeppackagenames
-adaptclassstrings
-keepattributes ConfField,Exceptions,InnerClasses,Signature,Deprecated,SourceFile,LineNumberTable,LocalVariable*Table,*Annotation*,Synthetic,EnclosingMethod
-keep class !com.starrocks.epack.** { *; }
-keep class com.starrocks.StarRocksFE { *; }
-keepclassmembers public class * {void set*(***);*** get*();}
-dontnote
-ignorewarnings
-libraryjars <java.home>/jmods/java.base.jmod
-libraryjars <java.home>/jmods/java.datatransfer.jmod
-libraryjars <java.home>/jmods/java.prefs.jmod
-libraryjars <java.home>/jmods/java.xml.jmod
-libraryjars <java.home>/jmods/java.desktop.jmod
-printconfiguration